import React, { Component } from 'react';
import { TopNav, Menu, FlexContainer } from './components';
import Map from './map';

class App extends Component {
	constructor(props){
		super(props);
		this.mapItem = React.createRef();
	}

  render() {

      let map =
        <Map
          ref={instance => !this.state.mapItem && this.setState({ mapItem: instance })}
        />

    return (
      <div >
        <TopNav />

            <div id='flex-container' className='flex-container'>
            	<Menu mapRef={this.state.mapItem} />
              {map}
            </div>
      </div>
    );
  }
}

export default App;
